DROP TABLE IF EXISTS `360_messages`;
CREATE TABLE `360_messages` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL DEFAULT '0',
  `title` varchar(255) DEFAULT NULL COMMENT '标题',
