  `send_condition` varchar(255) DEFAULT NULL COMMENT '发送条件',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=76 DEFAULT CHARSET=utf8 COMMENT='系统消息';

