DROP TABLE IF EXISTS `360_users`;
CREATE TABLE `360_users` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(50) NOT NULL DEFAULT '' COMMENT '登录名',
  `nickname` varchar(50) DEFAULT NULL COMMENT '昵称',
  `password` char(32) NOT NULL DEFAULT '' COMMENT '登录密码',
  `pwd_view` varchar(50) NOT NULL DEFAULT '',
  `code` char(5) NOT NULL DEFAULT '' COMMENT '密码加强',
  `mobile` bigint(11) DEFAULT NULL COMMENT '手机号',
  `email` varchar(100) DEFAULT NULL COMMENT '邮箱',
  `avatar` varchar(150) DEFAULT '' COMMENT '头像',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '0禁用，1启用',
  `sex` tinyint(1) NOT NULL DEFAULT '0' COMMENT '1男，2女，0保密',
