  `height` smallint(3) unsigned NOT NULL DEFAULT '0' COMMENT '身高',
  `weight` smallint(3) unsigned NOT NULL DEFAULT '0' COMMENT '体重',
  `sign` varchar(255) DEFAULT NULL COMMENT '个性签名',
  `emotional` tinyint(1) NOT NULL DEFAULT '0' COMMENT '感情状态 0:"单身", 1:"已婚", 2:"离异", 3:"恋爱中"',
  `country` varchar(20) DEFAULT NULL COMMENT '国家',
  `address` varchar(255) DEFAULT NULL COMMENT '地址',
  `area` varchar(255) DEFAULT NULL COMMENT '所在城市',
  `role_id` int(11) NOT NULL DEFAULT '0',
  `insert_time` int(11) NOT NULL DEFAULT '0',
  `update_time` int(11) NOT NULL DEFAULT '0',
  `login_time` int(11) NOT NULL DEFAULT '0',
  `login_ip` varchar(16) DEFAULT '',
  `is_admin` tinyint(1) NOT NULL DEFAULT '0',
  `sort` smallint(3) NOT NULL DEFAULT '0',
  `openid` varchar(50) DEFAULT NULL,
  `online` varchar(10) DEFAULT NULL,
  `action_ip` varchar(255) DEFAULT NULL,
  `action_time` int(11) NOT NULL DEFAULT '0',
  `is_login` tinyint(1) NOT NULL DEFAULT '0',
  `points` int(11) NOT NULL DEFAULT '0' COMMENT '积分',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8 COMMENT='用户表';

