DROP TABLE IF EXISTS `360_video`;
CREATE TABLE `360_video` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `cat_id` int(11) NOT NULL DEFAULT '0' COMMENT '分类id',
  `title` varchar(100) NOT NULL DEFAULT '' COMMENT '标题',
  `tags` varchar(40) DEFAULT NULL COMMENT '类型|标签',
  `thumb` varchar(100) DEFAULT NULL COMMENT '封面图',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否显示',
  `score` float(2,1) DEFAULT '0.0' COMMENT '评分',
  `like` int(11) NOT NULL DEFAULT '0' COMMENT '收藏数',
  `good` int(11) NOT NULL DEFAULT '0' COMMENT '点赞数',
  `update_time` int(11) NOT NULL DEFAULT '0' COMMENT '更新时间',
  `insert_time` int(11) NOT NULL DEFAULT '0' COMMENT '操作时间',
  `comments` tinyint(3) NOT NULL DEFAULT '0' COMMENT '评论次数',
  `play` int(11) NOT NULL DEFAULT '0' COMMENT '播放次数',
  `flag` tinyint(1) NOT NULL DEFAULT '0',
  `channel` varchar(20) NOT NULL DEFAULT 'video',
  `content` text COMMENT '内容',
  `keywords` varchar(255) DEFAULT NULL COMMENT '关键字',
  `bad` tinyint(1) NOT NULL DEFAULT '0' COMMENT '点踩数',
  `video_url` text,
  `down_url` text,
  `description` varchar(255) DEFAULT NULL,
  `page` varchar(255) DEFAULT NULL,
  `col_id` tinyint(3) NOT NULL DEFAULT '0',
  `col_name` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `cat_id` (`cat_id`),
  KEY `tags` (`tags`),
  KEY `title` (`title`),
  KEY `title_2` (`title`,`cat_id`),
  KEY `channel` (`channel`)
) ENGINE=MyISAM AUTO_INCREMENT=139 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='资讯';

